import React from 'react';
import CarService from '../services/CarService';

class CarComponent extends React.Component{

    state={
        data: []
    }

    constructor(props){
        super(props);
    }

    componentDidMount(){
        fetch('http://localhost:8081/warehouse/cars')
            .then(data => data.json())
            .then(this.setState({data}));
    }

    render(){
        return(
        <div>
            <h1 >Car List</h1>
            <div>
                    {
                        this.state.data.map(
                            car =>
                            <div key={car.id}>
                                <div>{car.id}</div>
                                <div>{car.name}</div>
                            </div>
                        )
                    }
            </div>    
        </div>
        );
    }
}

export default new CarComponent();
